import {
  BrowserRouter,
  Routes,
  Route,
  useNavigationType,
  useLocation,
} from "react-router-dom";
import SignUpPage from "./pages/sign-up-page";
import LoginPage from "./pages/login-page";
import Userinfo from "./pages/userinfo";
import Desktop4 from "./pages/desktop4";
import Desktop3 from "./pages/desktop3";
import Desktop2 from "./pages/desktop2";
import Desktop1 from "./pages/desktop1";
import { useEffect } from "react";

import React from "react";
import ReactDOM from "react-dom";

type Products = {
  id: number;
  name: string;
  imageSrc: string;
  store: String,
  price: number,
  description: String
};

const Products = [
  {
    id: 1,
    name: "boAt Smartwatches Starts @999",
    imageSrc: "/61pbjsiyvel-12@2x.png",
    store: "Amazon",
    price: 5999,
    description: "Description of Product 1",
  },
  {
    id: 2,
    name: 'Laptop Stand @199.',
    imageSrc: '/roobai-298544s1-removebg-preview.png',
    store: "Amazon",
    price: 499,
    description: "Description of Product 2",
  },
  {
    id: 3,
    name: "Premium 750 Watt Mixer-Grinder",
    imageSrc: "/roobai-304240s1-removebg-preview.png",
    store: "Amazon",
    price: 4999,
    description: "Description of Product 3",
  },
  {
    id: 4,
    name: "Oreole Amaze Ultra High Speed 24 Inch",
    imageSrc: "/roobai-474947s1-removebg-preview.png",
    store: "Amazon",
    price: 1399,
    description: "Description of Product 4",
  },
  {
    id: 5,
    name: "Spin Mop Bucket with Pully",
    imageSrc: "/roobai-545402s1-removebg-preview.png",
    store: "Amazon",
    price: 1349,
    description: "Description of Product 4",
  },
  {
    id: 6,
    name: "aadi Synthetic |Lightweight|Comfort",
    imageSrc: "/roobai-546442s2-removebg-preview.png",
    store: "Amazon",
    price: 1999,
    description: "Description of Product 4",
  },
  {
    id: 7,
    name: "ASIAN Men's Super Shoes START @476",
    imageSrc: "/roobai-546446s1-removebg-preview.png",
    store: "Amazon",
    price: 1299,
    description: "Description of Product 4",
  },
  {
    id: 8,
    name: "Textured PU Leather Stylish Duffle Bags",
    imageSrc: "/roobai-546459s1-removebg-preview.png",
    store: "Amazon",
    price: 1500,
    description: "Description of Product 8",
  }
];


ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
      <Route path="/" element={<App />} />
        {/* Other routes */}
        <Route
          path="/desktop-3/:productId"
          element={<Desktop3 />} // No need to pass productId here
        />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);

function App() {
  const action = useNavigationType();
  const location = useLocation();
  const pathname = location.pathname;

  useEffect(() => {
    if (action !== "POP") {
      window.scrollTo(0, 0);
    }
  }, [action, pathname]);

  useEffect(() => {
    let title = "";
    let metaDescription = "";

    switch (pathname) {
      case "/":
        title = "";
        metaDescription = "";
        break;
      case "/login-page":
        title = "";
        metaDescription = "";
        break;
      case "/userinfo":
        title = "";
        metaDescription = "";
        break;
      case "/desktop-4":
        title = "";
        metaDescription = "";
        break;
      case "/desktop-3":
        title = "";
        metaDescription = "";
        break;
      case "/desktop-2":
        title = "";
        metaDescription = "";
        break;
      case "/desktop-1":
        title = "";
        metaDescription = "";
        break;
    }

    if (title) {
      document.title = title;
    }

    if (metaDescription) {
      const metaDescriptionTag: HTMLMetaElement | null = document.querySelector(
        'head > meta[name="description"]'
      );
      if (metaDescriptionTag) {
        metaDescriptionTag.content = metaDescription;
      }
    }
  }, [pathname]);

  return (
    <Routes>
      <Route path="/" element={<SignUpPage />} />
      <Route path="/login-page" element={<LoginPage />} />
      <Route path="/userinfo" element={<Userinfo />} />
      <Route path="/desktop-4" element={<Desktop4 />} />
      <Route
          path="/desktop-3/:productId"
          element={<Desktop3 />} // No need to pass productId here
        />
      <Route path="/desktop-2" element={<Desktop2 />} />
      <Route path="/desktop-1" element={<Desktop1 />} />
    </Routes>

  );
}
export default App;
